import React from 'react';
import {useState} from "react";
import './index.css'

function Button(){

    const [user,setUser] = useState([
        {name:'Igor',age:20,id:1},
        {name:'Nazar',age:30,id:2},
        {name:'Oleksandra',age:40,id:3},
    ])



    return <div>
        {user.map((user)=>{
            <div key = {user.id}>
                <h2>{user.name}</h2>
                <p>{user.age}</p>
            </div>
        })}
    </div>

}

export default Button;
